871.','',1),(16200,'urn:nbn:de:kobv:b4-200905194973','Eine neue Art von Strahlen','','','','Wilhelm Conrad','Röntgen','','','','','','','','1896',1,NULL,NULL,'Ausgabe v. 1896 ist die zweite Auflage des Sonderdruckes \"Über eine neue Art von Strahlen (Vorläufige Mittheilung)\". Erstmals erschienen als: Sonderdruck aus den Sitzungsberichten der Würzburger Physik.-medic. Gesellschaft 1895 (Vorläufige Mittheilungen), dann 1896 ebenfalls als Sonderdruck aus den Sitzungsberichten der Würzburger Physik.-medic. Gesellschaft 1895 (II. Mittheilung). Eine Erstausgabe ist seit Oktober 2010 bei Wikisource unter http://de.wikisource.org/w/index.php?title=Seite:%C3%9Cber_eine_neue_Art_von_Strahlen_01.jpg&oldid=1289709 verfügbar. ','','2013-07-31 14:49:35',9,'','','','','CHINA\r\nIMG 0007 und 0021 mit Verlagswebung; für Lfg. nach China ausgeschnitten. Geclippte Images im Clipping-Ordner\r\n\r\naq\r\n\r\n1 Tabelle',0,'2013-07-31 14:49:35','','','','','2. Auflage','','1896','Würzburg','Stahel','','12 S.','',12,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,'',NULL,NULL,'118745743','','','','','','','','Konrad Röntgens Aufsatz \"Über eine neue Art von Strahlen\" erschien erstmals als \"Vorläufige Mittheilung\" in einem Sonderdruck \"aus den Sitzungsberichten der Würzburger Physik.-medic. Gesellschaft 1895\". In der Bayerischen Staatsbibliothek München, der Staatsbibliothek zu Berlin – Preußischer Kulturbesitz sowie der Niedersächsischen Staats- und Universitätsbibliothek Göttingen konnte kein sicherer Nachweis auf ein verfügbares Exemplar der Erstausgabe ermittelt werden. Daher wurde für das DTA die 2. Auflage aus der Staatsbibliothek zu Berlin – Preußischer Kulturbesitz zur Digitalisierung herangezogen.','','','','','','','','','','','','Röntgen, Wilhelm Conrad: Eine neue Art von Strahlen. 2. Aufl. Würzburg, 1896.','',1),(16201,'urn:nbn:de:kobv:b4-20090519971','Einleitung in die Geisteswissenschaften','Versuch einer Grundlegung für das Studium der Gesellschaft und der Geschichte','',NUL