rt zum dritten Band ist datiert auf den Juli 1794, der Band erschien noch im selben Jahr.','','','','','','','','','','','','Forster, Georg: Ansichten vom Niederrhein. Bd. 3. Berlin, 1794.','',1),(16622,'urn:nbn:de:kobv:b4-200905191395','Johann Reinhold Forster\'s [...] Reise um die Welt während den Jahren 1772 bis 1775','In dem von seiner itztregierenden Großbrittannischen Majestät auf Entdeckungen ausgeschickten und durch den Capitain Cook geführten Schiffe the Resolution unternommen','','','Georg','Forster','','','','','','','','1778',1,NULL,NULL,'daneben im selben Jahr auch erschienen als Bd. 4 der Reihe: Geschichte der See-Reisen und Entdeckungen im Süd-Meer (Vgl. auch: Georg Forsters Werke: Sämtliche Schriften, Tagebücher, Briefe. Bd. 4: Streitschriften und Fragmente zur Weltreise, Erläut. u. Reg. zu Bd. I-IV. Bearb. v. Robert L. Kahn, Gerhard Steiner, Horst Fiedler, Klaus-Georg Popp, Siegfried Scheibe. 1972. 2., unveränd. Aufl. 1989. S. 164ff.\r\nBerlin: Akademie-Verl.; http://books.google.de/books?id=HJ-nkXF9Bu0C&pg=PA196&dq=erschienen+in:+Forster+Geschichte+der+See-Reisen+und+Entdeckungen+im+S%C3%BCd-Meer,+Band+4&hl=de&sa=X&ei=qtvVT-iLGMzntQb73M28Dw&ved=0CEMQ6AEwAQ#v=onepage&q=erschienen%20in%3A%20Forster%20Geschichte%20der%20See-Reisen%20und%20Entdeckungen%20im%20S%C3%BCd-Meer%2C%20Band%204&f=false)','','2013-03-20 13:27:23',38,'','','','','CHINA\r\nfr, fr-fr, fr-aq, kursiv\r\nIni\r\nlb-Zeichen (z.B. S. +++3 in der fn)\r\nfn\r\ndurchgehend Marginalien\r\ncw, bs\r\nunpaginierte Tafeln zwischen den Textseiten\r\n\r\nvorgebundene große Falttafel in 4 Scans aufgeteilt\r\n\r\nSeitenzählung erst ab IMG 46 - nach Bogensignaturen gehend, müsste aber alles korrekt sein.\r\n\r\nDruckfehler bei der Seitenzählung von IMG 476 bis 483. Eigentlich Seiten 417 bis 424 hier aber gedruckt als \"409\" bis \"416\" (doppelt). Bogensignaturen aber korrekt.',0,'2012-10-23 14:50:33','','','','','','','1778','Berlin','Haude und Spener','','[17] Bl., 451 S., [1] gef. Bl., Bl. II-VII