likation in Buchform, weshalb die Nachlassedition für das DTA herangezogen wurde.','','','','','','','','','','','','Droste-Hülshoff, Annette von: Letzte Gaben. Nachgelassene Blätter. Hrsg. v. Levin Schücking. Hannover, 1860.','',1),(17188,'urn:nbn:de:kobv:b4-200905191561','Die Flußpiraten des Mississippi',NULL,NULL,NULL,'Friedrich','Gerstäcker',NULL,NULL,'','',NULL,NULL,NULL,'1848',1,NULL,NULL,'\"Alternativ: \"Die Regulatoren v. Arkansas\" (1848). Wichtig für die Entwicklung der Jugendliteratur, wirkte u.a. als Vorbild für Karl May; Umfang geschätzt\"','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1848','Leipzig','Wigand',NULL,'3 Bde.','',300,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,3,'Bd. 1',NULL,NULL,'118538810',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Gerstäcker, Friedrich: Die Flußpiraten des Mississippi. Bd. 1. Leipzig: Wigand, 1848.',NULL,0),(17189,'urn:nbn:de:kobv:b4-200905191570','Die Flußpiraten des Mississippi',NULL,NULL,NULL,'Friedrich','Gerstäcker',NULL,NULL,'','',NULL,NULL,NULL,'1848',1,NULL,NULL,'\"Alternativ: \"Die Regulatoren v. Arkansas\" (1848). Wichtig für die Entwicklung der Jugendliteratur, wirkte u.a. als Vorbild für Karl May; Umfang geschätzt\"','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1848','Leipzig','Wigand',NULL,'3 Bde.','',300,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,3,'Bd. 2',NULL,NULL,'118538810',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Gerstäcker, Friedrich: Die Flußpiraten des Mississippi. Bd. 2. Leipzig: Wigand, 1848.',NULL,0),(17190,'urn:nbn:de:kobv:b4-200905191584','Die Flußpiraten des Mississippi',NULL,NULL,NULL,'Friedrich','Gerstäcker',NULL,NULL,'','',NULL,NULL,NULL,'1848',1,NULL,NULL,'\"Alternativ: \"Die Regulatoren v. Arkansas\" (1848). Wichtig für die Entwicklung der Jugendliteratur, wirkte u.a. als Vorbild für Karl May; Umfang geschätzt\"','',NUL