DROP TABLE IF EXISTS `open_tasks`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `open_tasks` (
  `id_book` int(10) unsigned NOT NULL,
  `id_task` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `task_name` varchar(255) DEFAULT NULL,
  `id_user` int(10) unsigned DEFAULT NULL,
  `starttime` datetime DEFAULT NULL,
  `endtime` datetime DEFAULT NULL,
  `realendtime` datetime DEFAULT NULL,
  `createDate` datetime DEFAULT NULL,
  `comments` mediumtext,
  `id_book_locations` int(10) unsigned DEFAULT NULL,
  `physical_location` varchar(255) DEFAULT NULL,
  `parent_task` int(10) unsigned DEFAULT '0',
  `active` tinyint(4) DEFAULT NULL,
  `activate_date` datetime DEFAULT NULL,
  `log_last_change` datetime DEFAULT NULL,
  `log_last_user` int(11) DEFAULT NULL,
  `task_type` int(11) DEFAULT NULL,
  `closed` tinyint(4) DEFAULT '0',
  `grouped_task` tinyint(4) DEFAULT NULL,
  `group_task_id` int(11) DEFAULT NULL,
  `id_fundstelle` int(11) DEFAULT NULL,
  PRIMARY KEY (`id_book`,`id_task`),
  UNIQUE KEY `id_task` (`id_task`),
  KEY `id_book` (`id_book`),
  KEY `id_task_2` (`id_task`),
  KEY `id_user` (`id_user`),
  KEY `endtime` (`endtime`),
  KEY `starttime` (`starttime`),
  KEY `id_book_locations` (`id_book_locations`),
  KEY `active` (`active`),
  KEY `activate_date` (`activate_date`),
  KEY `closed` (`closed`),
  KEY `task_type` (`task_type`),
  KEY `group_task_id` (`group_task_id`),
  KEY `realendtime` (`realendtime`),
  KEY `createDate` (`createDate`),
  KEY `parent_task` (`parent_task`),
  KEY `closed_2` (`closed`,`active`)
) ENGINE=MyISAM AUTO_INCREMENT=6604 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

